import * as React from "react";

export default function AmountItem() {
    return (
        <div className="amount-item">
            <div className="amount-text">Amount</div>
            <img src="https://cdn.builder.io/api/v1/image/assets/TEMP/128706fc1cbf8e5dd9d15f3bba763f1fcb1075407a6b10d0aea40af3c9a99cea?apiKey=dab1d767c7fa4022a44c79fa035746a8&" alt="" className="amount-icon" />
            <div className="edit-text">Edit</div>
            <img src="https://cdn.builder.io/api/v1/image/assets/TEMP/3c231b5e8e16489ddf8f575b8cedd66359e177f641a25f55aa86cee61038749b?apiKey=dab1d767c7fa4022a44c79fa035746a8&" alt="" className="icon" />
        </div>
    );
}
